(224, '24974', 'Caneta Marc. Ponta Dupla Neutral Grey Ref. NG4', '19.78', '5', '128', '6080', '0', 'Desc.: Caneta Marc. Ponta Dupla Chameleon Ref. NU2\r\nRef. NU2\r\nCod.Fab.: CT0125\r\nMaterial/Modelo: \r\nGramatura:\r\nTamanho:\r\nCapacidade:\r\nCor: Light Peach BG1\r\nMarca: Chameleon\r\nCod. Barras: 812751021254\r\nQTD por pacote: 3 Unidades\r\nCod. Bar. pacote: \r\n\r\nQTD por caixa:\r\nCod. Bar. Caixa:  \r\n\r\nQTD caixa Master: \r\nCod. Bar. Caixa Master:\r\n\r\nInformações Adicionais:\r\nCom 52 opções, os marcadores Chameleon proporcionam efeitos incríveis. O domínio desta ferramenta permitirá que seu desenho encontre tonalidades únicas e um degradé sensacional, sua criatividade será o limite, para efeitos 3D, sombreamentos, transição de cores.com suavidades e muito mais. Além das 50 cores vibrantes, que tem duas pontas, uma brush e outra em forma de marcador, vale destacar as outras duas opções, a Colorless blender, que permitem corrigir ou suavizar tons, e a Detail, ideal para os detalhes e contornos do seu desenho, com duas pontas de espessuras diferentes, 4mm e 6mm, disponível na cor preta. Como explicar o degradê das 50 cores? Simples. Os marcadores possuem duas substâncias, a tinta e o clareador. Ao colocar uma das pontas em contato com a ponta do clareado ocorre à mistura que permite esse efeito único. Outra possibilidade fantástica, é que essas são canetas recarregáveis e com pontas substituíveis, o que não só permite um menor descarte de material, poupando o meio ambiente, quanto possibilita um custo inferior a médio e longo prazo, quando utilizadas da forma correta. Além disso os marcadores são a base de álcool, não tóxicas e com baixo odor. É importantíssimo destacar que a prática é fundamental para atingir toda as possibilidades oferecidas por essa ferramenta. Seja para o degradê, ou para uma transição mais simples de cor, o que pode ser usado em Mangá, trabalhos de artesanato, scrapbooks e até para caligrafia e lettering, um efeito cada vez mais impressionante e impressionável, só será atingido com o domínio das características do material. Para isso sugerimos os vídeos que você pode encontrar em nossas redes sociais, ou nas da própria Chameleon Pens Brasil.', '[{\"preco\": 19.78, \"tabela\": \"CUSTO MÉDIO\", \"promocional\": false}, {\"preco\": 19.78, \"tabela\": \"CUSTO FINAL\", \"promocional\": false}, {\"preco\": 39.5, \"tabela\": \"BALCAO\", \"promocional\": false}, {\"preco\": 38.5, \"tabela\": \"PREÇO MIN\", \"promocional\": false}]', 4, 0, NULL, NULL),
