(411, '22264', 'Estilete Estreito Metálico 9mm Ref.ES0902', '0', '1', '197', '607', '0', 'Desc.: Estilete Estreito Metálico 9mm Ref.ES0902\r\nRef.: ES0902                \r\nCod.Fab.:  ES0902\r\nMaterial/Modelo: \r\nGramatura:\r\nTamanho: 9mm \r\nCapacidade:\r\nCor: Sortido\r\nCod.Bar.Unitário: 7898613212971\r\nMarca: BRW\r\n\r\nQTD por Pacote: 12 Unidade\r\n\r\nQTD por Caixa: 30 Blister\r\n\r\nQTD Caixa Master: 720 Blister\r\n\r\nInformações Adicionais:\r\nO Estilete Metálico 9mm c/ Clip de Bolso BRW tem o formato compacto ideal para aplicações simples e rotineiras, como para cortes de correspondências, caixas de encomendas, linhas, fitas, atividades escolares e também para artesanatos. \r\nPrático, preciso e totalmente seguro, possui corpo de metal, sistema com trava, estrutura reforçada e quebrador de lâmina eficiente. Também conta com trava deslizante, proporcionando o armazenamento da lâmina no interior do item enquanto não estiver em uso. Além disso, seu clip de bolso promove facilidade para carregá-lo para qualquer lugar. \r\nSua utilização é extremamente simples, basta deslizar a trava para fora e recolher a lâmina empurrando-a para trás após terminar. \r\nO Estilete 9mm BRW garante qualidade, alto desempenho, resistência e durabilidade combinado a um excelente custo benefício.\r\nLANÇAMENTOS', '[{\"preco\": 0, \"tabela\": \"TABELA MAX\", \"promocional\": false}, {\"preco\": 2.13, \"tabela\": \"CUSTO MÉDIO\", \"promocional\": false}, {\"preco\": 2.13, \"tabela\": \"CUSTO FINAL\", \"promocional\": false}, {\"preco\": 5.3, \"tabela\": \"BALCAO\", \"promocional\": false}, {\"preco\": 4.75, \"tabela\": \"PREÇO MIN\", \"promocional\": false}, {\"preco\": 0, \"tabela\": \"PRECO FABRICA\", \"promocional\": false}]', 6, 0, NULL, NULL),
