(788, '25042', 'Pincel Evoke Water Brush c/4 Ref. BP0300', '18.52', '5', '128', '6052', '0', 'Desc.:  Pincel Evoke Water Brush c/4 Ref. BP0300\r\nRef: BP0300            \r\nCod.Fab.NF.: BP0300 \r\nMaterial/Modelo: \r\nGramatura:\r\nTamanho:\r\nCapacidade:\r\nCor:\r\nCod.Bar.Unitário: 7898419163538\r\nMarca: BRW\r\n\r\nQTD por Pacote: 4 Unidades\r\nCod. Bar. Pacote: 7898675509224\r\n\r\nQTD por Caixa: 24 Blister\r\n\r\nQTD Caixa Master: 192 Blister\r\n\r\n\r\nInformações Adicionais:\r\nO Pincel Artístico Water Brush BRW é um acessório prático para artistas profissionais, amadores e entusiastas. Com quatro diferentes tamanhos de pincel, é possível explorar os mais diversos campos de ilustração e pintura de maneira prática e bem versátil! \r\nSeu corpo é composto por três peças: depósito transparente de 6mL; ponta resistente com cerdas sintéticas macias e flexíveis; e tampa para proteção contra sujeiras. Conta com tamanho compacto, ergonômico, portátil e de fácil manuseio, o que o torna uma ótima opção para levar em viagens ou para realização de urbans sketchings.\r\nPara diferentes efeitos, seu reservatório pode ser preenchido com água, tinta aquarela líquida ou nanquim. Além disso, pode ser utilizado como pincel comum somente molhando as cerdas na água.\r\nSeu traço varia de acordo com a pressão colocada e a quantidade de líquido distribuído sob o papel, sendo perfeito para técnicas tanto secas quanto úmidas.\r\nÉ ideal para uso com lapis aquareláveis, tintas aquarelas e tintas guache.\r\n', '[{\"preco\": 18.52, \"tabela\": \"CUSTO MÉDIO\", \"promocional\": false}, {\"preco\": 19.1, \"tabela\": \"CUSTO FINAL\", \"promocional\": false}, {\"preco\": 36.6, \"tabela\": \"BALCAO\", \"promocional\": false}, {\"preco\": 33.33, \"tabela\": \"PREÇO MIN\", \"promocional\": false}]', 4, 0, NULL, NULL),
