(870, '25041', 'Pincel Marca Texto 5 Cores Vintage Ref. CA2018', '14', '4', '128', '413', '0', 'Desc.: Pincel Marca Texto 5 Cores Vintage Ref. CA2018\r\nRef.CA2018                              \r\nCod.Fab.: CA2018\r\nMaterial/Modelo: \r\nGramatura:\r\nTamanho: 2,7X1,6X10,50CM Ponta 6mm\r\nCapacidade:\r\nCor: Vermelho, Marrom, Cinza, Azul, Preto\r\nCod.Bar.Unitário: 7898675508999\r\nMarca: BRW\r\n\r\nQTD por pacote: 5 Unidades\r\nCod. Bar. pacote: 7898675508999\r\n\r\nQTD por caixa: 12 Blister\r\n\r\nQTD caixa Master: 72 Blister\r\n\r\nInformações Adicionais:\r\nAs cores do kit marca-texto vintage BRW buscam trazer a ideia do antigo com cara de algo novo e moderno.\r\nSeus tons escuros são ideais para destacar textos e colorir grandes áreas. o kit ainda inclui a cor preta, que possui tecnologia que cobre escritos e traços para impedir que sejam reproduzidos em copiadoras, mas ainda mantém o texto legível no papel original.\r\nPossui ponta resistente, firme e chanfrada, para marcação em traços finos e grossos. E a tinta à base de água tem secagem rápida e alta durabilidade, podendo ser utilizado nos mais diversos tipos de papéis.\r\nO kit contém 5 marcadores com cores lindas e formato confortável que traz firmeza ao utilizá-lo.', '[{\"preco\": 14, \"tabela\": \"CUSTO MÉDIO\", \"promocional\": false}, {\"preco\": 14, \"tabela\": \"CUSTO FINAL\", \"promocional\": false}, {\"preco\": 26.8, \"tabela\": \"BALCAO\", \"promocional\": false}, {\"preco\": 24.43, \"tabela\": \"PREÇO MIN\", \"promocional\": false}]', 4, 0, NULL, NULL),
